    [],nt"revision_timestamp": "2016-07-27T22:48:46.236910",nt"name": "remote-sensing-mississippi-river",nt"isopen":
    false,nt"url": null,nt"notes": "The purpose of this project is to use high
    resolution color infra red digital imagery during peak vegetative growth in order
    to develop a cover map for the Mississippi River flood plain. This information will
    be used to identify changes within the basin over the past 10 years (time since
    the last systemic imagery was collected and analyzed by the Service and USGS), strategically
    guide biological programs in support of natural resource conservation, and assist
    decision makers from the FWS, COE, USGS, states, and NGO's et al in making science-based
    decisions in the collaborative management of the resources within the Mississippi
    River Basin.",nt"license_title": "License Not Specified",nt"extras":
